import React, { useState } from "react";
import { axiosInstance } from "../api/api";

const CreateDossier = () => {
  const [formData, setFormData] = useState({
    patientId: "",
    resumeMedical: "",
    groupeSanguin: "",
    antecedents: "",
    allergies: "",
    contactUrgence: { nom: "", telephone: "", lien: "" }
  });

  const handleChange = (e) => {
    const { name, value } = e.target;
    if (name.startsWith("contact")) {
      const key = name.split(".")[1];
      setFormData({
        ...formData,
        contactUrgence: { ...formData.contactUrgence, [key]: value }
      });
    } else {
      setFormData({ ...formData, [name]: value });
    }
  };

  const handleSubmit = async (e) => {
    e.preventDefault();

    try {
      const payload = {
        ...formData,
        antecedents: formData.antecedents.split(",").map(a => ({ libelle: a.trim() })).filter(Boolean),
        allergies: formData.allergies.split(",").map(a => ({ libelle: a.trim() })).filter(Boolean)
      };

      await axiosInstance.post("/dossiers", payload);

      alert("✅ Dossier créé avec succès !");
      setFormData({
        patientId: "",
        resumeMedical: "",
        groupeSanguin: "",
        antecedents: "",
        allergies: "",
        contactUrgence: { nom: "", telephone: "", lien: "" }
      });

    } catch (err) {
      console.error(err);
      alert(err.response?.data?.message || "❌ Erreur serveur");
    }
  };

  return (
    <div style={{ padding: "20px" }}>
      <h2>Créer un Dossier Patient</h2>
      <form onSubmit={handleSubmit}>
        <input name="patientId" placeholder="ID Patient" value={formData.patientId} onChange={handleChange} /><br/><br/>
        <textarea name="resumeMedical" placeholder="Résumé Médical" value={formData.resumeMedical} onChange={handleChange} /><br/><br/>
        <input name="groupeSanguin" placeholder="Groupe Sanguin" value={formData.groupeSanguin} onChange={handleChange} /><br/><br/>
        <input name="antecedents" placeholder="Antécédents (séparés par ,)" value={formData.antecedents} onChange={handleChange} /><br/><br/>
        <input name="allergies" placeholder="Allergies (séparés par ,)" value={formData.allergies} onChange={handleChange} /><br/><br/>
        <input name="contact.nom" placeholder="Nom Contact Urgence" value={formData.contactUrgence.nom} onChange={handleChange} /><br/><br/>
        <input name="contact.telephone" placeholder="Téléphone Contact" value={formData.contactUrgence.telephone} onChange={handleChange} /><br/><br/>
        <input name="contact.lien" placeholder="Lien avec le patient" value={formData.contactUrgence.lien} onChange={handleChange} /><br/><br/>
        <button type="submit">Créer Dossier</button>
      </form>
    </div>
  );
};

export default CreateDossier;
